import { Image, Reveal } from 'semantic-ui-react'

class WOD extends Component {
    state = {  }
    render() {
        const { name, workout, category, score } = this.props.workout
        return (
            <Reveal animated='move'>
                <Reveal.Content visible>
                <Image src='https://res.cloudinary.com/fittco/image/upload/w_1920,f_auto/fsn8oi2bqyynritul0a3.jpg' size='medium' />
                </Reveal.Content>
            <Reveal.Content hidden>
                <h2>{name}</h2>
                <h3>{category}</h3>
                <h4></h4>
                <h4>{score}</h4>
            </Reveal.Content>
            </Reveal>
        );
    }
}

export default WOD;
